    if (config.link) { linkObj.link = config.link; }
    if (config.onClick) { linkObj.onClick = `fly01.go("${config.onClick}")`; }
    if (config.label) { linkObj.label = config.label; }

    if (config.link || config.onClick || config.label) aEl.push(fly01.snppts.link(linkObj));
