      const cy2 = - Math.cos(radian) * radius;
      this.hand.setAttribute("x2", cx1);
      this.hand.setAttribute("y2", cy1);
      this.bg.setAttribute("cx", cx2);
      this.bg.setAttribute("cy", cy2);
